  },
  {
    image: Images.food.icecream,
    title: "Ice Cream Jolibee",
    rate: "⭐️ 4/5",
    price: "$2.34",
  },
  {
    image: Images.food.potato,
    title: "Ice Cream Jolibee",
    rate: "⭐️ 4/5",
    price: "$2.34",
  },
];
